import { describeImage, generateEmbedding } from "./gemini.ts";
import { prisma } from "./prisma.ts";

async function imageUrlToBase64(url: string): Promise<string> {
  const res = await fetch(url);
  const buffer = Buffer.from(await res.arrayBuffer());
  return buffer.toString("base64");
}

async function processItems() {
  console.log("ðŸ” Fetching items missing embeddings...");

  const items = await prisma.item.findMany({
    where: {
      embedding: null,
      imageUrl: { not: null },
    },
    select: {
      id: true,
      imageUrl: true,
    },
  });

  console.log(`Found ${items.length} items.`);

  for (const item of items) {
    try {
      console.log(`ðŸ“Œ Processing item ${item.id}...`);

      // A. convert to Base64
      const base64 = await imageUrlToBase64(item.imageUrl!);

      // B. describe image
      const description = await describeImage(base64);

      // C. embed description
      const vector = await generateEmbedding(description);

      const vectorString = `[${vector.join(",")}]`;

      // D. Store vector into Postgres `vector` column
      await prisma.item.update({
        where: {
            id: item.id
        },
        data: {
            embedding: vectorString,
        }
      })

      console.log(`âœ”ï¸ Saved embedding for item ${item.id}`);
    } catch (err) {
      console.error(`âŒ Error processing item ${item.id}:`, err);
    }
  }

  console.log("ðŸŽ‰ Done!");
}

/**
 * Run
 */
processItems()
  .then(() => process.exit(0))
  .catch((err) => {
    console.error(err);
    process.exit(1);
  });

